import './App.css'

function App() {
	const [songs, setSongs] = useState([])

	useEffect(() => {
		// Функция для получения данных с бэкенда
		const fetchData = async () => {
			try {
				const response = await fetch('/api/songs')
				const data = await response.json()
				setSongs(data)
			} catch (error) {
				console.error('Error fetching data:', error)
			}
		}

		// Вызываем функцию при монтировании компонента
		fetchData()
	}, []) // Пустой массив зависимостей гарантирует, что эффект выполняется только один раз при монтировании

	return (
		<div className='App'>
			<div id='player'>
				<div id='song-title'>Now Playing: Song Title</div>

				<div id='controls'>
					<button>Previous</button>
					<button>Play</button>
					<button>Next</button>
				</div>
			</div>
		</div>
	)
}

export default App
